def minimumSkew(dna):
    skew = 0
    min = 0
    minList = []
    for i in range(len(dna)):
        if dna[i] == 'C':
            skew -= 1
        elif dna[i] == 'G':
            skew += 1
        if (skew == min):
            minList.append(str(i + 1))
        elif (skew < min):
            minList.clear()
            minList.append(str(i + 1))
            min = skew

    return ' '.join(minList)

